import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone 15');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button.png'));

    // Wait for search suggestions
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_suggestions.png'));

    // Click on the first suggestion
    await page.waitForSelector('.suggestion-item', { timeout: 5000 });
    await page.click('.suggestion-item');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_first_suggestion.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_first_suggestion.png'));

    // Verify task completion
    const resultsCount = await page.locator('.results-count').innerText();
    const extractedData = { resultsCount };

    return {
      success: true,
      action: "Performed search autocomplete test",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
